static float mathLogf(const float _x) {
   union {
      float f;
      unsigned int u;
   } bx;
   bx.f = _x;
   const unsigned int ex = bx.u >> 23;
   const signed int t = (signed int)ex - (signed int)127;
   const unsigned int s = (t < 0) ? (-t) : t;
   bx.u = 1065353216u | (bx.u & 8388607u);
   return
      -1.7417939f + (2.8212026f + (-1.4699568f + (0.44717955f - 0.056570851f * bx.f)*bx.f)*bx.f)*bx.f
      + 0.6931471806f * t;
}

static float mathPowerf(float _x, float _y) {
   float r;
   if(_y != 0.0f)
   {
      if(_x < 0.0f)
      {
         r = (float)( -expf(_y*mathLogf(-_x)) );
      }
      else if(_x > 0.0f)
      {
         r = (float)( expf(_y*mathLogf(_x)) );
      }
      else
      {
         r = 0.0f;
      }
   }
   else
   {
      r = 1.0f;
   }
   return Dstplugin_fix_denorm_32(r);
}

static void loc_prepare(st_plugin_voice_t *_voice);

void loc_prepare(st_plugin_voice_t *_voice) {
   ST_PLUGIN_VOICE_CAST(ext_mod_test_5_3b_voice_t);
   ST_PLUGIN_VOICE_SHARED_CAST(ext_mod_test_5_3b_shared_t);

   float out = 0.0f;
   (void)out;
   // -------- lane "prepare" modIdx=0 modString=pow
   
   // -- mod="pow" dstVar=out
   
   // ---- mod="pow" input "base" seq 1/1
   
   // -- mod="10" dstVar=voice->tmp1/*base*/
   voice->tmp1/*base*/ = 10.0f;
   
   // ---- mod="pow" input "exp" seq 1/1
   
   // -- mod="$m_drive" dstVar=voice->tmp2/*exp*/
   voice->tmp2/*exp*/ = voice->mod_drive_cur;
   
   // -- mod="3" dstVar=voice->tmp2/*exp*/
   voice->tmp2/*exp*/ *= 3.0f;
   out = mathPowerf(voice->tmp1/*base*/, voice->tmp2/*exp*/);
   
   // -- mod="sto v_drive_pre" dstVar=out
   voice->var_v_drive_pre_next = out;
   
   // -- mod="rcp" dstVar=out
   if(0.0f != out)
      out = 1.0f / out;
   
   // -- mod="sto v_drive_post" dstVar=out
   voice->var_v_drive_post_next = out;
} /* end prepare */


